import logo from "../images/logo192.png";
import "./Navbar.css";
export default function Navbar() {
  return (
    <nav className="nav">
      <a href="#" >
      <img src={logo} alt="logo" />
      <span>React</span>
      </a>
      <h3>React Course - project-1</h3>
    </nav>
  );
}
